/*
    ## RegExp Handler

    https://github.com/ForbesLindesay/regexp
    https://github.com/dmajda/pegjs
    http://www.regexper.com/


        {
            type: '',
            offset: number,
            text: '',
            body: {},
            escaped: true/false
        }

    type 
        alternate             |         
        match                 
        capture-group         ()        
        non-capture-group     (?:...)   
        positive-lookahead    (?=p)     
        negative-lookahead    (?!p)     
        quantified            a*        
        quantifier            *         
        charset               []        
        range                 {m, n}    
        literal               a         
        unicode               \uxxxx    Unicode
        hex                   \x        
        octal                 
        back-reference        \n        
        control-character     \cX       

        // Token
        start               ^       
        end                 $       
        any-character       .       
        backspace           [\b]    
        word-boundary       \b      
        non-word-boundary   \B      
        digit               \d      ASCII [0-9]
        non-digit           \D       ASCII [^0-9]
        form-feed           \f      
        line-feed           \n      
        carriage-return     \r      
        white-space         \s      
        non-white-space     \S      
        tab                 \t      
        vertical-tab        \v      
        word                \w      ASCII [a-zA-Z0-9]
        non-word            \W       ASCII [^a-zA-Z0-9]
        null-character      \o      NUL 
 */

var Util = require('../util')
var Random = require('../random/')
    /*

