    path = path || []
    var result = {
        name: typeof name === 'string' ? name.replace(Constant.RE_KEY, '$1') : name,
        template: template,
        type: Util.type(template), //  { 'name|1': [{}, {} ...] }
        rule: Parser.parse(name)
